import React from "react";

export default function MainWindow(props) {
  const 
       title = props.title,
       data = async()=> {return await props.season_leaders_players}
 
  return (
    <section>
        <h2>{title}</h2>    
        {console.log(data().PromiseResult)}
    </section>
  );
}
